text:
 @daviamaral6500  Como não interferiu cara? Você já jogou algum esporte? Sabe a interferência psicológica que faz ter dois pênaltis seguidos sendo marcados?

Cuiabá jogou melhor, mas será que o São Paulo não jogaria melhor se o primeiro pênalti não tivesse abalado a confiança dos jogadores?

Outra vez, mesmo com o VAR o São Paulo foi prejudicado. E isso não tira o mérito dos jogadores do Cuiabá, mas sim, mostra novamente a incompetencia da arbitragem no Brasil!
